import React from "react";
import { CardMedia, CardContent, Typography, CardActions, Button } from "@material-ui/core";

const Mem = (props) => {
  return (
    <div>
        <Card>
            <CardMedia style={{height:0, padding: 15}}
            image={props.mem.fields.img}
            title={props.mem.fields.title}
            />
            <CardContent>
                <Typography gutterBottom variant="headline" component="h2">
                    {props.mem.fields.title}
                </Typography>
            </CardContent>
            <CardActions>
                <Button size="small" color="primary">Upvote</Button>
            </CardActions>

        </Card>
      <h1>{title}</h1>
      <img src={img} />
    </div>
  );
};

export default Mem;
